import "../Home.css";
import styles from "../App.css"
import background_image from "../images/background.png";
import logoImage from "../images/logo.svg";
import gifImage from "../../src/gif.gif";
import NavBar from "../NavBar";
import TransitionBtn from "../TransitionBtn";

function Home() {
    return (
        <div className="Home" style={{ 

          backgroundImage: `url(${background_image})`,
          height: "90vh",
        }}>
          <NavBar></NavBar>
          <p style={{

            display:"",
            color:"transparent",
            fontSize:"0px"
          }}>dummy</p>
          <div className="logoWrapper" style={{
            display:"flex",
            width:"100%",
            height:"50%",
            justifyContent:"space-around",
            background:"transparent",
            marginTop:"15%",
          }}>

            <div className="leftLogo" style={{ 
              display:"flex",
              alignItems:"center", 
              height:"100%",
              lineHeight:"100%", 

            }}>
              <img src={logoImage} style={{

                position: "relative",
                filter: "drop-shadow(0px, 4px, 4px, rgba(0, 0, 0, 0.25))",
              }}> 
              </img>
            </div>


            <div className="rightGif" style={{
              display:"flex",
              alignItems:"center", 

            }}> 
              <img src={gifImage} alt="gif loading" style={{
                width:"80vh",
                position: "relative",

              }} />
            </div>
          </div>

          <TransitionBtn navUrl="About"/>



        </div>


      );
}
export default Home;
